19	1	2	1	PROMOTION DE LA SANTE	528	L'un des dfis majeur du secteur sant est d'agir sur les dterminants de la sant et donner aux\r\nindividus les moyens de maitriser et d'amliorer leur tat de sant.\r\nDans ce programme, le MINSANTE veut contribuer  induire par des actions cibles des changements\r\nde comportement dans la population et amener les individus  adopter des modes de vie sains	-	La mise en oeuvre se fera  travers les actions suivantes:\r\n-\tPromotion des comportements favorables  la sant\r\n-\tRenforcement de la planification familiale\r\n-\tAmlioration du milieu de vie des populations\r\n-\tRenforcement de la participation communautaire\r\n-\tPromotion de la sant de l'adolescent\r\n		Actif	2016-03-03	2017-10-31	Agir sur les dterminants de la sant et donner aux individus les moyens de\r\nmaitriser et d'amliorer leur tat de sant	\N	\N	\N	\N	\N
20	1	1	1	GOUVERNANCE ET APPUI INSTITUTIONNEL DANS LE SECTEUR SANTE	530	La stratgie de ce programme repose sur les objectifs spcifiques suivants:\r\n-Mettre en place un systme performant d'approvisionnement, de distribution, de stockage et d'utilisation\r\nde mdicaments de qualit  tous les niveaux ;\r\n-Amliorer l'offre des soins et des services tant au milieu hospitalier que communautaire ;\r\n-Assurer la disponibilit et l'utilisation optimales des ressources humaines de qualit ;\r\n-Amliorer l'accessibilit financire des populations aux soins et services de sant ;\r\n-Amliorer la disponibilit et l'utilisation des informations sanitaires de qualit.\r\n-Amliorer le pilotage stratgique du secteur\r\n-Amliorer la gouvernance du secteur	--	La mise en oeuvre de ce programme se fera  travers les actions suivantes:\r\n\r\n-\tGestion des mdicaments, ractifs et dispositifs mdicaux\r\n\r\n-\tAmlioration de l'offre de soins et services de sant\r\n\r\n-\tRenforcement du financement de la sant et du partenariat\r\n\r\n-\tDveloppement des ressources humaines en sant\r\n\r\n-\tDveloppement du systme d'information sanitaire et la\r\n\r\n-\tRecherche oprationnelle en sant\r\n\r\n-\tPilotage stratgique du secteur\r\n\r\n-\tContrle et audit interne des structures		Actif	2016-03-03	2017-10-31	Amliorer la coordination des services et assurer la bonne mise en uvre des\r\nprogrammes	\N	\N	\N	\N	\N
18	1	2	1	PREVENTION DE LA MALADIE	527	La stratgie du programme prvention de la maladie repose sur les objectifs spcifiques suivants:\r\n-Rduire l'incidence / prvalence des principales maladies transmissibles ;\r\n-Rduire la prvalence des maladies chroniques non-transmissibles;\r\n-Renforcer le systme de surveillance intgr des maladies  potentiel pidmique et des vnements\r\nde sant publiques majeurs (catastrophes et urgences sanitaires,);\r\n-Amliorer l'utilisation des services de prvention de la maladie	-	La mise en action de ce programme se fera  travers les actions suivantes:\r\n-\tPrvention du paludisme\r\n-\tPrvention du VIH/SIDA, tuberculose, IST et hpatites virales\r\n-\tPrvention de la transmission du VIH de la mre  l'enfant\r\n-\tPrvention des maladies  potentiel pidmique(MAPE)\r\n-\tPrvention des maladies chroniques non transmissibles (MCNT)\r\n-\tPrvention des maladies tropicales ngliges (MTN)\r\n-\tPrvention des autres maladies\r\n		Actif	2016-03-03	2017-10-31	Amliorer la couverture des interventions de prvention de la maladie	\N	\N	\N	\N	\N
17	1	2	1	PRISE EN CHARGE DES CAS	 531	La stratgie du programme prise en charge des cas repose sur les objectifs spcifiques suivants:\r\n-Amliorer la prise en charge des cas et des complications des principales maladies transmissibles et\r\nnon-transmissibles ;\r\n-Amliorer prise en charge des cas et des complications lies  la sant de la mre ,du nouveau-n, de\r\nl'enfant et de l'adolescent .	 Conseiller Technique N3	La mise en oeuvre de cette action se fera  travers les actions suivantes:\r\n- Mise en uvre des interventions curatives  haut impact chez la mre, le nouveau-n, l'enfant et l'adolescent;\r\n- Prise en charge des urgences et des catastrophes ;\r\n- Prise en charge du VIH/SIDA, tuberculose, IST et hpatites virales ;\r\n- Prise en charge du paludisme ;\r\n- Prise en charge des maladies chroniques non transmissibles(MCNT) ;\r\n- Prise en charge des maladies tropicales ngliges et des autres maladies ;\r\n- Offre infrastructurelles et quipements des formations sanitaires.\r\n\r\nAUTRES MALADIES\r\nACTION 07: OFFRE INFRACSTRUCTURELLES ET EQUIPEMENTS DES FORMATIONS\r\nSANITAIRES		Actif	2016-03-03	2017-10-31	Amliorer l'accs des populations aux soins curatifs de qualit, notamment pour la cible mre et enfant en vue de rduire la charge morbide et la mortalit.	\N	\N	\N	\N	\N
