COPY revueprogramme (idrevue, idprogramme, cout, produits, contextmeo, difficultes, perspectives, priseencompte, faits, implications, ajustementactions, observations, etat, date_enregistre, derniere_modif) FROM stdin;
1	2	\N		La mise en uvre de ce programme obit aux orientations du  DSCE dans son volet dveloppement humain qui prconise  l'amlioration de l'tat de sant des populations , en cohrence avec les  OMD  4, 5, 6 spcifiques  la sant. \r\nLa Stratgie Sectorielle de la Sant prvoit deux domaines : le domaine de la lutte contre la maladie et celui de la promotion de la sant. Ces derniers temps la recrudescence des pidmies et des pandmies, le faible accs aux soins et aux mdicaments  pour la prise en charge des communauts sont des raisons qui confortent la pertinence de ce programme prioritaire de la feuille de route du MINSANTE. \r\nPour ce programme il s'agissait de rduire la charge morbide chez les pauvres et les populations les plus vulnrables,  travers  04 actions inscrites et excutes : \r\n-Amlioration de la disponibilit et l'accessibilit de l'offre des mdicaments, ractifs, et dispositifs essentiels ;\r\n- Prvention de la maladie et promotion de la sant ;\r\n- Prise en Charge globale et intgre des maladies ;\r\n- Renforcement du systme communautaire.\r\n	\N			\N	\N	\N	\N	Actif	2015-03-31	2015-03-31
2	20	\N		Malgr les rsultats positifs enregistrs par le MINSANTE ces dernires annes, Le diagnostic du secteur Sant a permis d'identifier la faible gouvernance et l'insuffisance du pilotage stratgique comme les principaux goulots d'tranglement dans le systme de sant au Cameroun. En ce qui concerne la gouvernance, elle est caractrise par: l'insuffisance du cadre lgislatif et rglementaire; la faible transparence et redevabilit ; la participation insuffisante des bnficiaires au processus gestionnaire et l'insuffisance des comptences des gestionnaires. Pour ce qui est du pilotage stratgique, il est caractris par: un dispositif institutionnel inappropri ; un fonctionnement inadquat de la chaine  planification, programmation, budgtisation et suivi-valuation  ; une faiblesse de la veille stratgique ; une lenteur du processus de dconcentration/dcentralisation  et une gestion non-optimale du partenariat national et international.\r\nOn note galement une faible performance des autres piliers du systme de Sant qui affecte la performance globale. Une analyse de chacun de ces piliers permet d'avoir les rsultats suivants :\r\n-Pour ce qui est du Financement de la Sant, (i) Le pays ne dispose pas d'une stratgie nationale de financement de la sant. (ii) Les diffrentes fonctions du financement (collecte des ressources, mcanismes de partage des risques, et achat des services de sant) ne rpondent donc pas  un cadre logique national.(iii) La Sant reste sous finance  travers le budget national (moins de 6% du budget national allou  la sant) et les mnages en supportent une part importante  travers les payements directs (52 % d'aprs les rsultats des comptes nationaux de 2011). (iv) Le taux d'excution budgtaire (base engagement) a oscill entre 88% et 96% sur la priode 2010-2015. \r\n-Concernant l'Offre des services et Soins de Sant,(i)Les hpitaux de 1re et de 2me catgorie qui constituent les deux types de Formations Sanitaires (FOSA) du niveau central ne parviennent pas  jouer pleinement leur rle de structures de rfrence ; principalement du fait de l'insuffisance des plateaux techniques appropris et des rfrences tardives. (ii) Ces hpitaux senss apport un appui spcialis aux FOSA du niveau dconcentr dlivrent plutt les Paquets Minimum et Complmentaire d'Activit (PMA et PCA) au mme titre que les hpitaux de districts et certains CMA.(iii) Afin d'amliorer l'accessibilit aux soins, des efforts sont faits pour subventionner la prise en charge de certaines maladies chroniques dans ces structures sanitaires notamment : les insuffisances rnales terminales ncessitant une dialyse et certains cancers.(iv)La plupart des structures de sant au niveau oprationnel n'ont pas un niveau de dveloppement  leur permettant d'offrir  de manire optimale le PMA et le PCA aux populations.A titre d'illustration, les rsultats de l'enqute PETS II conduite au niveau des Districts de sant montrent que 24,5% des formations sanitaires ne disposaient pas de boite d'accouchement, 39,5% manquaient de systme de strilisation  sec, 67,5% manquaient de boite de csarienne, 11,6% manquaient de microscopes fonctionnels.(v)La maintenance des quipements biomdicaux n'est pas assure  cause du manque de personnel multidisciplinaire comptent ddi  cette tche ; (vi)Les crdits de fonctionnement allous aux formations sanitaires sont insuffisants et difficiles  mobiliser au regard des procdures administratives en vigueur. L'analyse  de ce pilier dmontre la vulnrabilit de notre systme de soin qui pourrait tre amlior par une allocation suffisante des ressources financires au MINSANTE et le dveloppement de  l'achat stratgique  des interventions de sant.\r\n- S'agissant du secteur Pharmaceutique, laboratoire, mdicaments et autres produits mdicaux, (i)Le ratio pharmacien par habitant varie de 1 pour 6 920  1 pour 177 051 habitants en fonction des rgions. (ii) La dure moyenne   de rupture de stock de mdicaments traceurs au premier semestre 2015 tait de 18 jours . (iii) Certaines classes thrapeutiques sont dlivres gratuitement ou sont subventionnes (antituberculeux, antirtroviraux de 1re et 2eme lignes, combinaisons antipaludiques ACT, Artesunate et Artmether injectable pour les enfants de 0  5 ans, anti-lpromateux, certains anti-cancreux etc.). Le contrle de qualit qui est assur par le LANACOME n'est malheureusement pas systmatique pour les lots de mdicaments imports; par ailleurs l'inspection  des tablissements pharmaceutiques reste irrgulire. (iv) Le phnomne de l'offre informelle pharmaceutique s'est dvelopp de faon exponentielle exposant le consommateur  la consommation de  produits sous doss, contrefaits et parfois prims.\r\n- En ce qui concerne les Ressources Humaines en Sant, Le secteur de la sant en 2012 comptait   7 534 agents de sant toutes catgories confondues. (i) Le Plan stratgique de dveloppement des ressources humaines pour la sant (PSDRHS 2013-2020) relevait une  insuffisance de personnel dans les catgories suivantes : mdecins, pharmaciens, infirmiers qualifis et sages-femmes. Par ailleurs, on notait leur concentration dans les centres urbains, en particulier Yaound et Douala. On avait en outre  les ratios suivants : (i) Un mdecin pour 28 466 habitants en 2012, ce qui est infrieur aux normes de l'OMS qui recommande un mdecin pour 10 000 habitants (ii) Un Infirmier Diplm d'Etat pour 12 903 habitants, (iii) Une Sage-Femme pour 9 596 femmes en ge de procrer, (iv) Un infirmier qualifi (toute catgorie confondue) pour 2 442 habitants en 2012 pour une norme OMS d'un pour 3000 habitants.(ii) La multitude des coles de formation mdicale  et paramdicale   devrait aboutir   une surproduction des professionnels de sant  au cours des cinq prochaines annes. Cette situation poserait alors un rel problme d'absorption du personnel form avec un risque potentiel de mauvaises pratiques.(iii) on note galement une instabilit du personnel de sant au poste de travail. Les salaires pratiqus  ce jour  dans la fonction publique ne favorisent pas la rtention du personnel et expliquent en partie la fuite des cerveaux ; (iv) en effet, Le niveau de rmunration des RHS est bas quel que  soit la catgorie et le  corps considrs. En outre,  avec  la gratuit des soins pour les cibles mre et enfant, dans les formations sanitaires publiques, le personnel d'appui et de certains prestataires des soins pourtant indispensable et qui est  rmunr sur la  base du recouvrement des cots devient une proccupation majeure.\r\n- En ce qui concerne le Systme National d'Informations Sanitaires (SNIS) et la Recherche en Sant , (i) on note une fragmentation du cadre institutionnel et organisationnel du SNIS et une multiplicit de sous-systmes d'information et d'outils de collecte des donnes.(ii) Une faible allocation des ressources aux activits de recherche.\r\n	\N			\N	\N	\N	\N	Actif	2016-03-31	2016-04-26
3	20	\N	Produit N 1 : .....................................................................................................................................................................................\r\n\r\nProduit N 2 : .....................................................................................................................................................................................\r\n\r\nProduit N 3 : .....................................................................................................................................................................................\r\n\r\nProduit N 4 : .....................................................................................................................................................................................\r\n\r\nProduit N 5 : .....................................................................................................................................................................................\r\n\r\nProduit N 6 : .....................................................................................................................................................................................	Le Document de Stratgie pour la Croissance et lEmploi (DSCE) adopt en 2009 est selon le Chef de lEtat  le cadre de rfrence de laction gouvernementale . Il sarticule sur trois Axes notamment lAxe Croissance, lAxe Emploi et lAxe Gestion Stratgique de lEtat et Gouvernance. Sagissant particulirement de lAxe Croissance, il repose sur cinq piliers dont le Dveloppement Humain qui constitue lancrage stratgique sur lequel repose les interventions du secteur sant. Ainsi, le MINSANTE, socle institutionnel desdites interventions a pour mission prpondrante :  damliorer ltat de sant des populations .\r\nPour atteindre lobjectif sus-vis, le Ministre de la Sant Publique a mis en uvre le budget programme conformment  la loi N2007/006 du 26 dcembre 2007 portant Rgime Financier de lEtat et qui fait de la performance, une exigence  rechercher par toutes les administrations. Sur cette base, quatre programmes ont t labors dont le Programme  Gouvernance et Appui Institutionnel dans le Secteur Sant . Il vise  :  amliorer la coordination des services et  assurer la bonne mise en uvre des programmes .\r\nLes lments de contexte qui ont marqu lexcution du Programme 530 en 2015 sont : la baisse des recettes ptrolires, les grandes pidmies et pandmies dont la maladie  virus Ebola en Afrique de lOuest, les attaques du groupe terroriste Boko Haram dans lExtrme-Nord du Cameroun, la gestion des rfugis issus desdites attaques et de la crise en RCA.\r\nToutefois, les lments ci-dessus ne sauraient mettre en veilleuse les actions spcifiques excutes en 2015 par ledit Programme. Leur mise en uvre sera analyse dans le prsent Rapport Annuel de Performance et sarticule autour de la Coordination des Services dans toute la pyramide sanitaire ; le Dveloppement de la Recherche Oprationnelle en Sant Humaine ; lAmlioration du Cadre de Travail ; le Contrle et lAudit Interne des Services ; le Dveloppement du Systme dInformation Sanitaire ; les Etudes stratgiques et la Planification enfin ; la Gestion Budgtaire et Financire.\r\n\r\nPour mettre en oeuvre ce programme, un certain nombre dactions seront entreprises notamment :\r\n1-\tPilotage stratgique du secteur \r\n2-\tGestion des mdicaments, ractifs de laboratoire, dispositifs mdicaux et autres produits pharmaceutiques \r\n3-\tAmlioration de l'offre de soins et services de sant \r\n4-\tDveloppement des Ressources humaines en sant\r\n5-\t Renforcement du financement de la Sant et du Partenariat\r\n6-\tDveloppement du systme d'information sanitaire et la recherche en sant\r\n7-Contrle et audit interne des structures\r\n	\N	-\r\n\r\n-\r\n\r\n-\r\n\r\n-\r\n\r\n-\r\n\r\n-\r\n	-\r\n\r\n-\r\n\r\n-\r\n\r\n-	\N	\N	\N	\N	Actif	2019-07-02	2019-07-02
